import React from "react";
import Link from "next/link";

const NavBar = (props) => {

 // const [isLink, text, linkto] = props;

  return (
  <div className="card">
    <h2 className="card-title">{props.text}</h2>
    <div className="lower-titles-wrapper">
    {props.items.map(item=> <p key={item+1} className="lower-titles">{item}</p>)}
    </div>
    {props.hasOwnProperty('image')? <img className="card-image" src={props.image} alt="woman enjoying time at spa"/>: null}
  </div>)
};

export default NavBar;
